import React from "react";
import Email from '../assets/svg/icon-email.svg'
import map from '../assets/svg/icon-map.svg'
import Phone from '../assets/svg/icon-phone.svg'

export default class Footer extends React.Component {
  render() {
    return (
      <div style={{backgroundColor: '#259eb9'}} className="margin-footer">
        <div className="row">
          <div className="margin-row-footer">
            <div className="box-img-fot row">
              <img src={map} alt="email" style={{width: 22}}/><span className="text-footer mleft-30">Visit Us</span>
            </div> 

          </div>
          <div className="margin-row-footer">
            <div className="box-img-fot"><img src={Email} alt="email" style={{width: 25}}/></div>
          </div>
          <div className="margin-row-footer">
            <div className="box-img-fot"><img src={Phone} alt="email" style={{width: 25}}/></div>
          </div>
        </div>
      </div>
    );
  }
}
